import logo from "./img/logo.png";

function App() {
  return (
    <article className="main">
      <div className="content_box">
        <div className="side_menu">
          <h1 className="logo">
            <img src={logo} />
          </h1>
        </div>
        <div className="items"></div>
      </div>
    </article>
  );
}

export default App;
